					function setMarker(mark) {
					  markers = [];
					  info = [];

					  for (var i = 0; i < mark.length; i++) {
					    var point = new google.maps.LatLng(parseFloat(mark[i].latitude), parseFloat(mark[i].longitude));
					    var contentString =
					      "<table>" +
					      "<tr>" +
					      "<td align=center><img class=img-responsive width=150px src='/storage/outlet-img1/" +
					      mark[i].img1 +
					      "'></td>" +
					      "</tr>" +
					      "<tr>" +
					      "<td align=center><br><b>" +
					      mark[i].nama_outlet +
					      "</b></td>" +
					      "</tr>" +
					      "<tr>" +
					      "<td align=center width=300px>" +
					      mark[i].alamat +
					      "</td>" +
					      "</tr>" +
					      "<tr>" +
					      "<td align=center> Telp: " +
					      mark[i].telp +
					      "</td>" +
					      "</tr>" +
					      "</table>";

					    var infowindow = initializeInfoWindow(contentString);

					    var tanda = addMarkerToMap(peta, point, mark[i].kategori.icon);

					    markers.push(tanda);
					    info.push(infowindow);

					    google.maps.event.addListener(tanda, "click", (function (tanda, i) {
					      return function () {
					        info[i].open(peta, tanda);
					      };
					    })(tanda, i));
					  }
					  setMarkerCluster(peta, markers);
					}


